import React, { useRef, useEffect, useState } from 'react';
import { Pose } from '@mediapipe/pose';
import { Camera } from '@mediapipe/camera_utils';
import { calculateAngle } from './components/calculateAngle'; // Ensure this function is translated and available

const PushupTracker = () => {
  const videoRef = useRef(null);
  const canvasRef = useRef(null);
  const [counter, setCounter] = useState(0);
  const [stage, setStage] = useState('up');

  useEffect(() => {
    const onResults = (results) => {
      const image = results.image;
      const landmarks = results.poseLandmarks;

      if (!landmarks) {
        return;
      }

      const r1 = [landmarks[11].x * image.width, landmarks[11].y * image.height];
      const r2 = [landmarks[13].x * image.width, landmarks[13].y * image.height];
      const r3 = [landmarks[15].x * image.width, landmarks[15].y * image.height];
      const l1 = [landmarks[12].x * image.width, landmarks[12].y * image.height];
      const l2 = [landmarks[14].x * image.width, landmarks[14].y * image.height];
      const l3 = [landmarks[16].x * image.width, landmarks[16].y * image.height];
      const r4 = [landmarks[23].x * image.width, landmarks[23].y * image.height];
      const r5 = [landmarks[25].x * image.width, landmarks[25].y * image.height];
      const r6 = [landmarks[27].x * image.width, landmarks[27].y * image.height];
      const l4 = [landmarks[24].x * image.width, landmarks[24].y * image.height];
      const l5 = [landmarks[26].x * image.width, landmarks[26].y * image.height];
      const l6 = [landmarks[28].x * image.width, landmarks[28].y * image.height];
      const rpalm = [landmarks[17].x * image.width, landmarks[17].y * image.height];
      const lpalm = [landmarks[18].x * image.width, landmarks[18].y * image.height];

      const angleR = calculateAngle(r1, r2, r3);
      const angleL = calculateAngle(l1, l2, l3);
      const backAngleR = calculateAngle(r1, r4, r5);
      const backAngleL = calculateAngle(l1, l4, l5);
      const palmsDistance = Math.hypot(rpalm[0] - lpalm[0], rpalm[1] - lpalm[1]);
      const shoulderDiff = Math.abs(r1[1] - l1[1]);
      const hipDiff = Math.abs(r4[1] - l4[1]);
      const alignmentThreshold = 50;

      let hasError = false;
      let upperBodyColor = 'white';
      let lowerBodyColor = 'white';

      if (angleR <= 50 || angleL <= 50) {
        upperBodyColor = 'red';
      }
      if (backAngleR <= 120 || backAngleL <= 120) {
        lowerBodyColor = 'red';
        hasError = true;
      }
      if (palmsDistance < 50) {
        upperBodyColor = 'red';
      }
      if (shoulderDiff > alignmentThreshold || hipDiff > alignmentThreshold) {
        upperBodyColor = 'red';
        lowerBodyColor = 'red';
      }

      const ctx = canvasRef.current.getContext('2d');
      canvasRef.current.width = image.width;
      canvasRef.current.height = image.height;

      ctx.clearRect(0, 0, canvasRef.current.width, canvasRef.current.height);
      ctx.drawImage(image, 0, 0, canvasRef.current.width, canvasRef.current.height);

      drawLine(ctx, r1, r2, upperBodyColor);
      drawLine(ctx, r2, r3, upperBodyColor);
      drawLine(ctx, l1, l2, upperBodyColor);
      drawLine(ctx, l2, l3, upperBodyColor);
      drawLine(ctx, r1, l1, upperBodyColor);
      drawLine(ctx, r4, r5, lowerBodyColor);
      drawLine(ctx, r5, r6, lowerBodyColor);
      drawLine(ctx, l4, l5, lowerBodyColor);
      drawLine(ctx, l5, l6, lowerBodyColor);
      drawLine(ctx, r1, r4, lowerBodyColor);
      drawLine(ctx, l1, l4, lowerBodyColor);

      [r1, r2, r3, l1, l2, l3, r4, r5, r6, l4, l5, l6].forEach(joint => drawCircle(ctx, joint));

      if (!hasError) {
        if (angleL < 90 && angleR < 90) {
          if (stage === 'up') {
            setCounter(counter + 1);
            setStage('down');
          }
        }
        if (angleL > 90 && angleR > 90) {
          if (stage === 'down') {
            setStage('up');
          }
        }
      }
    };

    const pose = new Pose({
      locateFile: (file) => {
        return `https://cdn.jsdelivr.net/npm/@mediapipe/pose/${file}`;
      }
    });

    pose.setOptions({
      modelComplexity: 1,
      smoothLandmarks: true,
      minDetectionConfidence: 0.2,
      minTrackingConfidence: 0.2
    });

    pose.onResults(onResults);

    const startVideo = () => {
      const video = videoRef.current;
      const camera = new Camera(video, {
        onFrame: async () => {
          await pose.send({ image: video });
        },
        width: 640,
        height: 480
      });
      camera.start();
    };

    startVideo();

  }, [counter, stage]);

  const drawLine = (ctx, start, end, color) => {
    ctx.beginPath();
    ctx.moveTo(start[0], start[1]);
    ctx.lineTo(end[0], end[1]);
    ctx.strokeStyle = color;
    ctx.lineWidth = 4;
    ctx.stroke();
  };

  const drawCircle = (ctx, joint) => {
    ctx.beginPath();
    ctx.arc(joint[0], joint[1], 10, 0, 2 * Math.PI);
    ctx.fillStyle = 'white';
    ctx.fill();
  };

  return (
    <div>
      <h1>Push-up Counter: {counter}</h1>
      <video ref={videoRef} width="640" height="480" style={{ display: 'none' }} />
      <canvas ref={canvasRef} />
    </div>
  );
};

export default PushupTracker;
